literals:
"
.pjsconsole {
  opacity: .75;
  display: block;
  position: fixed;
  bottom: 0px;
  left: 0px;
  right: 0px;
  height: 50px;
  background-color: #aaa;
}"

"
.pjsconsole .dragger {
  display: block;
  border: 3px black raised;
  cursor: n-resize;
  position: absolute;
  top: 0px;
  left: 0px;
  right: 0px;
  height: 5px;
  background-color: #333;
}"

"
.pjsconsole .closer {
  opacity: .5;
  display: block;
  border: 3px black raised;
  position: absolute;
  top: 10px;
  right: 30px;
  height: 20px;
  width: 20px;
  background-color: #ddd;
  color: #000;
  line-height: 20px;
  text-align: center;
  cursor: pointer
}"

"
.pjsconsole .console {
  overflow-x: auto;
  display: block;
  position: absolute;
  left: 10px;
  right: 0px;
  bottom: 5px;
  top: 10px;
  overflow-y: scroll;
  height: 40px;
}"
